            email1: "",
            pass1: ""
        }    )
    const [password,setPassword]=useState('')
    const [allentry, setAllEntry] = useState([])

    const form=(event)=>{
        setEmail({...email,[event.target.name]:event.target.value})
    }
    const form2=(event)=>{
        setPassword([event.target.value])
    }
    const submit=(e)=>{
        e.preventDefault()

        if(email1==email && pass1==password){
            const name=email+password
            navigate1(`/loginpage/${name}`)


           }else{
            alert("invalid input data")
        }
    }   
  return (
    <div>

    <p>Username, Password</p>
    <form action='' onSubmit={submit}>
    <input type='text' name='email' id='email'  onChange={form} placeholder=' email ' />
    <input type='password' name='password' id='password'   onChange={form2} placeholder=' password '  />
    <button type='submit' >login</button> 
    </form>


    </div>
  )
}

export default Login
